import './App.css';
import React, { useState } from 'react';
import headerImg from "./images/bg-header-mobile.svg"
import Card from './Card';
import { JobData } from "./data"
import {FaTimes} from "react-icons/fa"

function App() {

  const [data, setData] = useState(JobData)
  const [filterData, setFilterData] = useState(["chsd","dxuhn","jidhcnu", "jidhcnu"]);


  const JobCard = data.map((items) => {

    return (<Card key={items.id} Data={items} />)
  }
  )
  return (
    <div className="App">
      <header className="App-header">
        <img src={headerImg} alt="pic" />
      </header>
      <div className='Job filter'>
        <div className='items'>
          {filterData.map((item, index) => {
            return (<div
              key={index} className='filterItems'>
              <p
              className="filterItem"
              >{item}</p>
              <FaTimes className='fa times'/>
              </div>
            )
          })}

        </div>
        <p className='clear'>Clear</p>
      </div>

      <div className='Jobs'>
          {JobCard}
      </div>


    </div>
  );
}

export default App;
